import React from 'react';
import {Table} from 'react-bootstrap';



const Group=(props) =>{
  return(
    <tr>
      <th>#</th>
      <th>{props.obj.name}</th>
      <th>{props.obj.description}</th>
      <th>{props.obj.bankAccount}</th>
      <th>{props.obj.members}</th>
      <th>{props.obj.frequency}</th>


    </tr>
)
}
export default Group;
